import React from 'react';
//import axios from "axios";

export default class ArchivePage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            archives:[],
        };
    }

    /*componentDidMount() {
        axios("/listarchives").then(({ data }) => {
            this.setState({
                archives: data
            });
        });
    }*/

    componentDidMount() {
        fetch('/listarchives')
          .then(response => response.json())
          .then(json => this.setState({ archives: json.data }));
      }


    render() {

        return(
            <div>
                {
                this.state.archives.length === 0
                    ? 'Loading users...'
